! function (e) {
	"use strict";
	e('a.js-scroll-trigger[href*="#"]:not([href="#"])').click(function () {
		if (location.pathname.replace(/^\//, "") == this.pathname.replace(/^\//, "") && location.hostname == this.hostname) {
			var t = e(this.hash);
			if ((t = t.length ? t : e("[name=" + this.hash.slice(1) + "]")).length) return e("html, body").animate({
				scrollTop: t.offset().top
			}, 1e3, "easeInOutExpo"), !1
		}
	}), e(".js-scroll-trigger").click(function () {
		e(".navbar-collapse").collapse("hide")
	}), e("body").scrollspy({
		target: "#sideNav"
	})
}(jQuery);

function changeOctaver() {
	var x = document.getElementById("completeCodeOctaver");
	var show = document.getElementById("showOctaver");
	var hide = document.getElementById("hideOctaver");
	if (x.style.display === "none") {
		x.style.display = "block";
		show.style.display = "none";
		hide.style.display = "block";
	} else {
		x.style.display = "none";
		show.style.display = "block";
		hide.style.display = "none";
	}
}

